import React, { useState } from 'react';
import { useDispatch } from 'react-redux'; // Usamos dispatch para enviar la transacción a Redux
import { processTransaction } from '../features/transactionSlice'; // Acción de Redux
import './PaymentForm.css'; // Asegúrate de importar los estilos

const PaymentForm = ({ producto, onClose }) => {
  const dispatch = useDispatch();
  const [numeroTarjeta, setNumeroTarjeta] = useState('');
  const [cvc, setCvc] = useState('');
  const [expMonth, setExpMonth] = useState('');
  const [expYear, setExpYear] = useState('');
  const [cardHolder, setCardHolder] = useState(''); 
  const [customerEmail, setCustomerEmail] = useState(''); 
  const [mensaje, setMensaje] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();
    const transactionData = {
      productoId: producto.id,
      monto: producto.precio,
      payment_method: {
        type: 'CARD',
        number: numeroTarjeta,
        cvc,
        exp_month: expMonth,
        exp_year: expYear,
        card_holder: cardHolder,
      },
      customerEmail,
      cardHolder,
    };

    // Despachamos la acción para procesar la transacción
    dispatch(processTransaction(transactionData))
      .then((result) => setMensaje('¡Gracias por tu compra! Transacción procesada'))
      .catch((error) => setMensaje('Error al procesar la transacción'));
  };

  return (
    <div className="react-modal-content">
      <h2>Formulario de Pago</h2>
      <form onSubmit={handleSubmit} className="payment-form">
        <div className="form-field">
          <label>Nombre del titular:</label> 
          <input
            type="text"
            value={cardHolder}
            onChange={(e) => setCardHolder(e.target.value)}
            placeholder="Juan Perez"
            required
          />
        </div>
        <div className="form-field">
          <label>Número de tarjeta:</label>
          <input
            type="text"
            value={numeroTarjeta}
            onChange={(e) => setNumeroTarjeta(e.target.value)}
            placeholder="4111 1111 1111 1111"
            required
          />
        </div>
        <div className="form-field">
          <label>CVC:</label>
          <input
            type="text"
            value={cvc}
            onChange={(e) => setCvc(e.target.value)}
            placeholder="123"
            required
          />
        </div>
        <div className="form-field">
          <label>Mes de expiración:</label>
          <input
            type="text"
            value={expMonth}
            onChange={(e) => setExpMonth(e.target.value)}
            placeholder="12"
            required
          />
        </div>
        <div className="form-field">
          <label>Año de expiración:</label>
          <input
            type="text"
            value={expYear}
            onChange={(e) => setExpYear(e.target.value)}
            placeholder="2025"
            required
          />
        </div>
        <div className="form-field">
          <label>Correo electrónico:</label>
          <input
            type="email"
            value={customerEmail}
            onChange={(e) => setCustomerEmail(e.target.value)}
            placeholder="email@ejemplo.com"
            required
          />
        </div>
        <button type="submit" className="pay-button">Pagar</button>
        <button type="button" className="close-button" onClick={onClose}>Cerrar</button>
      </form>
      {mensaje && <p>{mensaje}</p>}
    </div>
  );
};

export default PaymentForm;
